public class Solution {
    public int NumberOfGoodPartitions(int[] nums) {
        const int MOD = 1000000007;
        int n = nums.Length;
        Dictionary<int, int> lastPosition = new Dictionary<int, int>();
        long[] dp = new long[n + 1];
        dp[0] = 1; // Base case: empty array has one good partition

        for (int i = 0; i < n; i++) {
            dp[i + 1] = dp[i] * 2 % MOD; // Each element can potentially double the number of good partitions
            if (lastPosition.ContainsKey(nums[i])) {
                int j = lastPosition[nums[i]];
                dp[i + 1] = (dp[i + 1] - dp[j] + MOD) % MOD; // Remove partitions invalidated by the repeat
            }
            lastPosition[nums[i]] = i; // Update the last position of nums[i]
        }

        return (int)dp[n];
    }
}
